import React from "react";
import {Link} from "react-router-dom";


function Header(){
    return (

    <header>
        <h1>JAVA JUMP FINAL PROJECT</h1>
            <nav>
               <Link to="/login" class="link">Log In</Link>
               <Link to="/signup" class="link">Sign Up</Link> 
            </nav>
    </header>

    )
}

export default Header;
